- input: "TEXT\x1CC00274944\x1C.TEXT\x1C\x1CF3XN\x1CJanuary 15, 2014                                                                                                                                                                                                                                                December'13
    FEC Report Notes:                                                                                  In
    the process of implementing new accounting procedures, a disbursement in the amount
    of $19,420.53 was mistankenly made from PathPAC checking to the College of American
    Pathologists (CAP) checking.  The purpose of the check was to reimburse the CAP
    for expenses normally accounted to the Political Education Fund (PEF). The error
    will be corrected and noted on the January FEC report.  A check will be issued
    from CAP back to PathPAC to correct this error.\n"
